import React from "react";
import "../index.css";
import * as firebase from "firebase";
import Jumbotron from "react-bootstrap/Jumbotron";
import BG_IMG from "../images/Log.png";
export default class Log extends React.Component {
  constructor() {
    super();
    this.state = {};
  }

  componentDidMount() {
    this.setState({});
  }

  render() {
    return (
      <div
        style={{
          backgroundImage: "url(" + BG_IMG + ")",
          backgroundColor: "red",
          width: "80vw",
          height: "80vw",
          textAlign: "center",
          margin: "auto",
        }}
      >
        <Jumbotron>
          <h1>Training Log</h1>
          <p>This page is under development. </p>
        </Jumbotron>
      </div>
    );
  }
}
